#include "common.h"
using namespace std;

namespace smallestDistancePair {

class Solution {
public:
    int smallestDistancePair2(vector<int>& nums, int k) {
        int n = nums.size();
        sort(begin(nums), end(nums));
        int l = 0, r = nums[n-1] - nums[0];
        // invariant: cnt[l-1] < k, cnt[r] >= k (cnt[i] = # of pairs whose distance is smaller than i)
        while (l < r) {
            int m = l + (r-l)/2;
            int j = 0, cnt = 0;
            for (int i = 0; i < n; ++i) {
                while (j < n && nums[j] - nums[i] <= m) {
                    ++j;
                }
                cnt += j-i-1;
            }
            if (cnt < k) {
                l = m + 1;
            } else {
                r = m;
            }
        }
        return l;
    }
    int smallestDistancePair(vector<int>& nums, int k) {
        int res = 0;
        int n = nums.size();
        if (n > 1 && k > 0) {
            sort(nums.begin(), nums.end());
            int l = 0;
            int h = nums[n - 1] - nums[0];
            int last = 0;
            while (l <= h) {
                int m = (l + h) / 2;
                int cnt = 0;
                int d = 0;
                for (int i = 0; i < n - 1; ++i) {
                    int j = n - 1;
                    while (j > i && nums[j] - nums[i] > m) { --j; }
                    cnt += j - i;
                    
                    if (j > i && d < nums[j] - nums[i]) {
                        d = nums[j] - nums[i];
                    }
                }
                if (cnt >= k) {
                    last = d;
                }
                if (cnt < k) {
                    l = m + 1;
                } else if (cnt > k) {
                    h = m - 1;
                } else {
                    return d;
                }
            }
            cout << "outside: " << l << "<" << h << endl;
            return last;
        }
        return 0;
    }

private:
};

}

